def fetch_json(url):
    response = requests.get(url)
    data = response.json()
    return data


def fetch_data(url, file_name):
    s = requests.get(url).content
    df = pd.read_csv(io.StringIO(s.decode(encoding='utf-8')))
    df.to_csv(file_name, index=False)
    string_s = str(s)

    return


def fetch_json_pd(url):
    data = pd.read_json(url)
    return data


def fetch_s(url):
    s = requests.get(url).content
    return s


